import Image from './assets/LinkedIn.png';
import Image1 from './assets/GitHub.png';
import CSPPTLogo from './assets/csppt_logo.png'
import LancasterLogo from './assets/Lancaster.png';
import NotePad from './assets/Notepad.svg'
import More from './assets/More.png'
function TaskBar({toggleVisibility}) {
    return (
        <div className='TaskBar'>
            <div className='Tasks'>
                <div className='Task'><img src={Image} alt="LinkedIn Logo"></img></div>
                <div className='Task' source={"https://github.com/Kyrylo234/CSPPT"}><img src={Image1} alt="GitHub Logo"></img></div>
                <div className='Task'><img src={CSPPTLogo} alt="CSPPT Logo"></img></div>
                <div className='Task' onClick={toggleVisibility}><img src={NotePad} alt="NotePad"></img></div>
                <div className='Task'><img src={LancasterLogo} alt="lancaster Univeresity Logo"></img></div>
            </div>
            <img src={More} alt="More" className='Bottom'></img>
        </div>
    );
  }

  export default TaskBar;
